import React from 'react';
import TVrow from '../components/tvs/TVrow';
import styles from './TVshows.module.css';

const base_url = 'https://image.tmdb.org/t/p/original';

const TVshows = () => {
  return (
    <div className={styles.tv}>
      <h3 className={styles.title}>TV Shows</h3>
      <TVrow
        url="/tv/popular?api_key=8a45061d820fb7b5b5f574766f028ff6"
        category="Popular"
      />
      <TVrow
        url="/tv/top_rated?api_key=8a45061d820fb7b5b5f574766f028ff6"
        category="Top Rated"
      />
      {/* <TVrow
        url="/tv/latest?api_key=8a45061d820fb7b5b5f574766f028ff6"
        category="Latest"
      /> */}
    </div>
  );
};

export default TVshows;
